import React from 'react';
import {
    Navbar,
    NavbarBrand,
    Nav,
    NavItem,
    Container
}from 'reactstrap';
import {Link} from 'react-router-dom';

export const Navs=()=>{
    return(
        <Navbar className="bg-dark">
            <Container style={{color:'white'}}>
                <NavbarBrand><h3>Routes</h3></NavbarBrand>
                <Nav>
                    <NavItem><Link to='/items'>Items</Link></NavItem>
                    <NavItem className="ml-5"><Link to='/about'>About</Link></NavItem>
                </Nav>
            </Container>
        </Navbar>
    )
};
